schemaDefinition: "create or replace view GROUP_REFERENCE_CALLS_11_06(\n\tADVOCATE,\n\
  \tSYS_CREATED_ON,\n\tDV_ADVOCATE_2,\n\tDV_MODERATOR,\n\tDV_STATUS,\n\tCUSTOMER,\n\
  \tPSP_PER_INSERT_DT,\n\tBUSINESS_UNIT,\n\tSYS_TAGS,\n\tDV_BUSINESS_UNIT,\n\tPSP_PER_UPDATE_DT,\n\
  \tSYS_ID,\n\tDV_ADVOCATE,\n\tDATE_OF_CALL,\n\tSYS_MOD_COUNT,\n\tNUMBER,\n\tMODERATOR,\n\
  \tSYS_UPDATED_BY,\n\tPSP_PER_DELETE_DT,\n\tDV_CALL_ID,\n\tDV_CUSTOMER,\n\tCALL_ID,\n\
  \tADVOCATE_2,\n\tPREP_CALL_DATE,\n\tSYS_CREATED_BY,\n\tCALL_NNACV,\n\tNAME,\n\t\
  CUSTOMER_NOTES,\n\tSYS_UPDATED_ON,\n\tSTATUS,\n\tQUOTES,\n\tNOTES,\n\tREGISTRATION_LINK,\n\
  \tTOPIC,\n\tZOOMINAR_LINK,\n\tDV_GEO,\n\tGEO\n) as\nSELECT \"ADVOCATE\" as \"ADVOCATE\"\
  ,\n       \"SYS_CREATED_ON\" as \"SYS_CREATED_ON\",\n       \"DV_ADVOCATE_2\" as\
  \ \"DV_ADVOCATE_2\",\n       \"DV_MODERATOR\" as \"DV_MODERATOR\",\n       \"DV_STATUS\"\
  \ as \"DV_STATUS\",\n       \"CUSTOMER\" as \"CUSTOMER\",\n       \"PSP_PER_INSERT_DT\"\
  \ as \"PSP_PER_INSERT_DT\",\n       \"BUSINESS_UNIT\" as \"BUSINESS_UNIT\",\n  \
  \     \"SYS_TAGS\" as \"SYS_TAGS\",\n       \"DV_BUSINESS_UNIT\" as \"DV_BUSINESS_UNIT\"\
  ,\n       \"PSP_PER_UPDATE_DT\" as \"PSP_PER_UPDATE_DT\",\n       \"SYS_ID\" as\
  \ \"SYS_ID\",\n       \"DV_ADVOCATE\" as \"DV_ADVOCATE\",\n       \"DATE_OF_CALL\"\
  \ as \"DATE_OF_CALL\",\n       \"SYS_MOD_COUNT\" as \"SYS_MOD_COUNT\",\n       \"\
  NUMBER\" as \"NUMBER\",\n       \"MODERATOR\" as \"MODERATOR\",\n       \"SYS_UPDATED_BY\"\
  \ as \"SYS_UPDATED_BY\",\n       \"PSP_PER_DELETE_DT\" as \"PSP_PER_DELETE_DT\"\
  ,\n       \"DV_CALL_ID\" as \"DV_CALL_ID\",\n       \"DV_CUSTOMER\" as \"DV_CUSTOMER\"\
  ,\n       \"CALL_ID\" as \"CALL_ID\",\n       \"ADVOCATE_2\" as \"ADVOCATE_2\",\n\
  \       \"PREP_CALL_DATE\" as \"PREP_CALL_DATE\",\n       \"SYS_CREATED_BY\" as\
  \ \"SYS_CREATED_BY\",\n       SUM(\"CALL_NNACV\") as \"CALL_NNACV\",\n       \"\
  NAME\" as \"NAME\",\n       \"CUSTOMER_NOTES\" as \"CUSTOMER_NOTES\",\n       \"\
  SYS_UPDATED_ON\" as \"SYS_UPDATED_ON\",\n       \"STATUS\" as \"STATUS\",\n    \
  \   \"QUOTES\" as \"QUOTES\",\n       \"NOTES\" as \"NOTES\",\n       \"REGISTRATION_LINK\"\
  \ as \"REGISTRATION_LINK\",\n       \"TOPIC\" as \"TOPIC\",\n       \"ZOOMINAR_LINK\"\
  \ as \"ZOOMINAR_LINK\",\n       --CASE WHEN \"DV_GEO\" IN ('JPN','JAPAN') THEN 'JPN'\
  \ WHEN \"DV_GEO\"='APJ' THEN 'APAC' ELSE \"DV_GEO\" END as \"DV_GEO\",\n       \"\
  DV_GEO\" as \"DV_GEO\",\n       \"GEO\" as \"GEO\"\nFROM\n  (SELECT \"ADVOCATE\"\
  \ as \"ADVOCATE\",\n          \"SYS_CREATED_ON\" as \"SYS_CREATED_ON\",\n      \
  \    \"DV_ADVOCATE_2\" as \"DV_ADVOCATE_2\",\n          \"DV_MODERATOR\" as \"DV_MODERATOR\"\
  ,\n          \"DV_STATUS\" as \"DV_STATUS\",\n          \"CUSTOMER\" as \"CUSTOMER\"\
  ,\n          \"PSP_PER_INSERT_DT\" as \"PSP_PER_INSERT_DT\",\n          \"BUSINESS_UNIT\"\
  \ as \"BUSINESS_UNIT\",\n          \"SYS_TAGS\" as \"SYS_TAGS\",\n          \"STATUS\"\
  \ as \"STATUS_1\",\n          CASE WHEN \"DV_BUSINESS_UNIT\" = DM.\"ValueAtSource\"\
  \ THEN DM.\"ReportingValues\" END AS \"DV_BUSINESS_UNIT\",\n          \"PSP_PER_UPDATE_DT\"\
  \ as \"PSP_PER_UPDATE_DT\",\n          \"SYS_ID\" as \"SYS_ID\",\n          \"DV_ADVOCATE\"\
  \ as \"DV_ADVOCATE\",\n          \"DATE_OF_CALL\" as \"DATE_OF_CALL\",\n       \
  \   \"SYS_MOD_COUNT\" as \"SYS_MOD_COUNT\",\n          \"NUMBER\" as \"NUMBER\"\
  ,\n          \"MODERATOR\" as \"MODERATOR\",\n          \"QUOTES\" as \"QUOTES_1\"\
  ,\n          \"SYS_UPDATED_BY\" as \"SYS_UPDATED_BY\",\n          \"PSP_PER_DELETE_DT\"\
  \ as \"PSP_PER_DELETE_DT\",\n          \"DV_CALL_ID\" as \"DV_CALL_ID\",\n     \
  \     \"DV_CUSTOMER\" as \"DV_CUSTOMER\",\n          \"NOTES\" as \"NOTES_1\",\n\
  \          \"CALL_ID\" as \"CALL_ID\",\n          \"ADVOCATE_2\" as \"ADVOCATE_2\"\
  ,\n          \"PREP_CALL_DATE\" as \"PREP_CALL_DATE\",\n          \"REGISTRATION_LINK\"\
  \ as \"REGISTRATION_LINK_1\",\n          \"SYS_CREATED_BY\" as \"SYS_CREATED_BY\"\
  ,\n          \"CALL_NNACV\" as \"CALL_NNACV\",\n          \"NAME\" as \"NAME\",\n\
  \          \"CUSTOMER_NOTES\" as \"CUSTOMER_NOTES\",\n          \"TOPIC\" as \"\
  TOPIC_1\",\n          \"SYS_UPDATED_ON\" as \"SYS_UPDATED_ON\",\n          \"ZOOMINAR_LINK\"\
  \ as \"ZOOMINAR_LINK_1\",\n          \"DV_GEO\" as \"DV_GEO\",\n          \"GEO\"\
  \ as \"GEO\",\n          (\"STATUS_1\") :: string as \"STATUS\",\n          (\"\
  QUOTES_1\") :: string as \"QUOTES\",\n          (\"NOTES_1\") :: string as \"NOTES\"\
  ,\n          (\"REGISTRATION_LINK_1\") :: string as \"REGISTRATION_LINK\",\n   \
  \       (\"TOPIC_1\") :: string as \"TOPIC\",\n          (\"ZOOMINAR_LINK_1\") ::\
  \ string as \"ZOOMINAR_LINK\"\n   FROM \"RDS\".\"SURF\".\"X_SNC_GROUP_REFERE_GROUP_REFERENCE_CALLS\"\
  \n    LEFT JOIN \"RDS\".\"FLATFILESOURCE\".\"MKT_DIMENSION_MAPPING_TABLE\" DM\n\
  \    WHERE DM.\"CategoryType\" = 'random' AND DM.\"ActiveFlag\" = 'random') Projection_1\n\
  GROUP BY \"ADVOCATE\",\n         \"SYS_CREATED_ON\",\n         \"DV_ADVOCATE_2\"\
  ,\n         \"DV_MODERATOR\",\n         \"DV_STATUS\",\n         \"CUSTOMER\",\n\
  \         \"PSP_PER_INSERT_DT\",\n         \"BUSINESS_UNIT\",\n         \"SYS_TAGS\"\
  ,\n         \"DV_BUSINESS_UNIT\",\n         \"PSP_PER_UPDATE_DT\",\n         \"\
  SYS_ID\",\n         \"DV_ADVOCATE\",\n         \"DATE_OF_CALL\",\n         \"SYS_MOD_COUNT\"\
  ,\n         \"NUMBER\",\n         \"MODERATOR\",\n         \"SYS_UPDATED_BY\",\n\
  \         \"PSP_PER_DELETE_DT\",\n         \"DV_CALL_ID\",\n         \"DV_CUSTOMER\"\
  ,\n         \"CALL_ID\",\n         \"ADVOCATE_2\",\n         \"PREP_CALL_DATE\"\
  ,\n         \"SYS_CREATED_BY\",\n         \"NAME\",\n         \"CUSTOMER_NOTES\"\
  ,\n         \"SYS_UPDATED_ON\",\n         \"STATUS\",\n         \"QUOTES\",\n  \
  \       \"NOTES\",\n         \"REGISTRATION_LINK\",\n         \"TOPIC\",\n     \
  \    \"ZOOMINAR_LINK\",\n         \"DV_GEO\",\n         \"GEO\";"
